            style={{
              width: 460,
              position: "absolute",
              top: " 10%",
              left: 100,
            }}
          />
        </div>

        <div
          style={{
            position: "absolute",
            width: "50%",
            height: "-webkit-fill-available",
            left: "50%",
            background: "#FFF3CC",
